IF (SELECT name FROM sys.sysdatabases WHERE name = 'CustomersNew') IS NULL
BEGIN
	CREATE DATABASE CustomersNew
END

GO

USE CustomersNew

IF OBJECT_ID('Expenses','U') IS NOT NULL
BEGIN
	DROP TABLE "Expenses"
END

GO

CREATE TABLE "Expenses"
(
"Id" INTEGER IDENTITY PRIMARY KEY NOT NULL,
"Date" DATE,
"Summ" DECIMAL(15,2),
"Number" INTEGER,
"Comment" NVARCHAR(10)
)

GO

IF OBJECT_ID('Customers','U') IS NOT NULL
BEGIN
	DROP TABLE "Customers"
END

GO

CREATE TABLE "Customers"
(
"Id" INTEGER IDENTITY PRIMARY KEY NOT NULL,
"NameCompany" NVARCHAR(50),
"Account" NVARCHAR(28),
"City" NVARCHAR(50),
"Account1" NVARCHAR(28),
"Region" NVARCHAR(20),
"PhoneNumber" NVARCHAR(30),
"Fax" NVARCHAR(30),
"Mail" NVARCHAR(50),
"File" NVARCHAR(255),
"UNP" NVARCHAR(10)
)

GO

IF OBJECT_ID('Contracts','U') IS NOT NULL
BEGIN
	DROP TABLE "Contracts"
END

GO

CREATE TABLE "Contracts"
(
"Id" INTEGER IDENTITY PRIMARY KEY NOT NULL,
"ClientId" INTEGER,
"Date" DATE,
"Number" INTEGER,
"Summ" DECIMAL(15,2),
"Prepayment" DECIMAL(15,2),
"Available" BIT,
"File" NVARCHAR(255),
"Comment" NVARCHAR(20)
)

GO

IF OBJECT_ID('Income','U') IS NOT NULL
BEGIN
	DROP TABLE "Income"
END

GO

CREATE TABLE "Income"
(
"Id" INTEGER IDENTITY PRIMARY KEY NOT NULL,
"ClientId" INTEGER,
"Summ" DECIMAL(15,2),
"Date" DATE,
"Number" INTEGER,
"TypePaiment" BIT DEFAULT 1
)

GO

SET IDENTITY_INSERT "Expenses" ON


